import React, { Component } from 'react';
import './HexagonGallery.css';
import { HexGrid, Layout, Hexagon, GridGenerator } from 'react-hexgrid';

class HexagonGallery extends Component {
	render() {
		const hexagons = GridGenerator.parallelogram(-2, 3, -2, 1);

		return(
			<HexGrid width={1200} height={1000} className="HexagonGallery">
				<Layout size={{ x: 7, y: 7 }}>
					{ hexagons.map((hex, i) => 
						<Hexagon key={i} q={hex.q} r={hex.r} s={hex.s}>
							<h1>Test</h1>
						</Hexagon>) 
					}
				</Layout>
			</HexGrid>
		);
  }
}

export { HexagonGallery };
